import React from "react";
import Button from "@mui/material/Button";

interface GreetingProps {
	name: string; // `name` propの型を定義
}

function App(props) {
	return (
		<div>
			<Button
				variant="contained"
				color="primary"
				onClick={() => alert("クリックされました")}
			>
				ボタン
			</Button>
		</div>
	);
}

export default App;
